import React from "react";
import TemplateAnime from "../Elementos/templateAnime"


function kimetsu(){
    return(
        <div>
            <TemplateAnime LinkAnime="https://iframe.mediadelivery.net/embed/64523/ffa34cc4-0d2c-4b6e-9387-f23026383dd1?autoplay=true" TituloAnime="Demon Slayer: Kimetsu no Yaiba " TituloCap="Episodio 1 – Crueldad" DescAnime="Tanjiro es un joven muy trabajador que se esfuerza mucho por cuidar de su madre y sus hermanos, pero cuando un día nevado baja de la montaña a vender carbón, jamás habría esperado encontrarse lo que se encontró al regresar a casa."/>
        </div>
    );
}

export default kimetsu;
